import React from 'react';
import { useState } from 'react';

const Deneme = ({ cart }) => {
    return (
        <div className="basket-container">
          <h2>Sepetiniz</h2>
          {cart.length === 0 ? (
            <p>Sepetinizde ürün bulunmamaktadır.</p>
          ) : (
            <ul>
              {cart.map((id) => (
                <li key={id}>{id}</li>
              ))}
            </ul>
          )}
        </div>
      );
};

export default Deneme;
